import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import axios from "axios";

function App() {

  const useAPI = () => {
    axios.get(process.env.REACT_APP_API_URL)
        .then((res) => {
          return res;
        })
  }

  return (
    <div className="App">
      {/*<Router>*/}
      {/*  */}
      {/*</Router>*/}
        {process.env.REACT_APP_API_URL}
    </div>
  );
}

export default App;
